import Axios from './callerService';

export let createRequest = (request) => {
  return Axios.post('request', request);
};

let getRequests = () => {
  return Axios.get('request');
};

let getRequestById = (id) => {
  return Axios.get(`request/${id}`);
};

let deleteRequestById = (id) => {
  return Axios.delete(`request/${id}`);
};

let updateRequestById = (id, request) => {
  return Axios.put(`request/${id}`, request);
};

export const requestService = {
  createRequest,
  getRequests,
  getRequestById,
  deleteRequestById,
  updateRequestById
};
